    <script>
      new Vue({
        el: '#app',
        data() {
          return {
            data: '',
            clientId: '',
          };
        },
        mounted() {
          this.clientId = Math.floor(Math.random() * 10000000000000000);
          // this.getSnapshot()
        },
        methods: {
          getSnapshot() {
            axios
              .get('/shougang', {
                params: {
                  clientId: this.clientId,
                },
              })
              .then(res => {
                this.data = res.data;
                window.setInterval(() => {
                  this.update();
                }, 3000);
              });
          },
          update() {
            axios
              .get('/shougangUpdate', {
                params: {
                  clientId: this.clientId,
                },
              })
              .then(response => {
                console.log(response.data);
              });
          },
        },
      });
      //调整浏览器窗口大小事件
      window.onresize = function() {
        // autoZoom();
      };
      autoZoom();
      function autoZoom() {
        var svg = document.getElementById('main');
        if (svg) {
          var setHeight = (setWidth * viewBoxHeight) / viewBoxWidth;
          svg.setAttribute('preserveAspectRatio', 'xMinYMin meet');
          svg.setAttribute('viewBox', `0 0 ${document.body.clientWidth - 400} ${document.body.clientHeight}`);
          svg.style.overflow = 'hidden';
          var viewBoxVal = svg.getAttribute('viewBox');
          if (viewBoxVal) {
            var viewBoxWidth = viewBoxVal.split(' ')[2];
            var viewBoxHeight = viewBoxVal.split(' ')[3];
            svg.removeAttribute('width');
            svg.removeAttribute('height');
            var setWidth = document.body.clientWidth;
            var setHeight = (setWidth * viewBoxHeight) / viewBoxWidth;
            svg.setAttribute('width', setWidth);
            svg.setAttribute('height', setHeight);
            // svg.setAttribute("viewBox", `0 0 ${setHeight} ${document.body.clientWidth}`);
            svg.setAttribute('viewBox', `-400 0 952 2340`);
          }
        }
      }
    </script>
  </body>
</html>
